    },
    menuButton: {
      marginLeft: -12,
      marginRight: 20
    }
  }
};*/

ReactDOM.render(
  <MuiThemeProvider theme={theme}>
    <App /*styles={styles}*/ />
  </MuiThemeProvider>,

  document.getElementById("root")
);

